  \"2016-11-25T21:06:27.714719\",\n\t\"name\": \"2011-national-indian-education-study\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The National Indian Education Study, 2011
  (NIES 2011), is a study that is part of the National Indian Education Study (NIES)
  within the National Assessment of Educational Progress (NAEP) program. NIES 2011
  (http://nces.ed.gov/nationsreportcard/nies/) is a cross-sectional survey that is
  designed to describe the condition of education for American Indian and Alaska Native
  (AI/AN) students in the United States. Students in public, private, Department of
  Defense, and Bureau of Indian Education-funded schools were sampled and then assessed
  using a paper-and-pencil assessment instrument. The weighted response rates ranged
  from 80 to 92 percent. Key statistics produced from NIES 2011 provides educators,
  policymakers, and the public with information about the academic performance in
  reading and mathematics of AI/AN fourth- and eighth-graders, as well as information
  about their exposure to Native American culture.\",\n\t\"license_title\": \"Creative
